import React from 'react';
import { link } from 'react-router-dom';

export const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <link to="./">Home</link>
                </li>
                <li>
                    <link to="">About</link>
                </li>
                <li>
                    <link to="">Login</link>

                </li>
            </ul>
        </nav>
    )
}
